export const size = {
    XS: 12,
    S: 16,
    M: 26,
    L: 42,
}

export const lineheight = {
    XS: 10,
    S: 20,
    M: 30,
    L: 50,
}

export const h1 = {
    fontSize: size.L,
    lineHeight: lineheight.L,
}

export const h2 = {
    fontSize: size.M,
    lineHeight: lineheight.M,
}

export const h3 = {
    fontSize: size.S,
    lineHeight: lineheight.S,
}

export const body1 = {
    fontSize: size.M,
    lineHeight: lineheight.M,
}

export const body2 = {
    fontSize: size.S,
    lineHeight: lineheight.S,
}

export const caption = {
    fontSize: size.XS,
    lineHeight: lineheight.XS,
}
